import React from "react";
import Navbar from "./Navbar";


type TProps = {}

export type TMenuItem = {
    id: number
    innerText: string
    desctiption: string
    path: string
}


const NavbarContainer: React.FC<TProps> = () => {

    const menu: Array<TMenuItem> = [
        {id: 1, desctiption: 'mainPage', path: '/main', innerText: 'главная'},
        {id: 2, desctiption: 'aboutUs', path: '/about', innerText: 'о нас'},
        {id: 3, desctiption: 'catalog', path: '/catalog/*', innerText: 'каталог продукции'},
        {id: 4, desctiption: 'contacts', path: '/contacts', innerText: 'контакты'},
    ]

    const catalog: Array<TMenuItem> =[
        {id: 1, desctiption: 'wire', path: '/catalog/wire/*', innerText: 'Провод'},
        {id: 2, desctiption: 'sheets', path: '/catalog/sheets/*', innerText: 'Листы'},
        {id: 3, desctiption: 'bars', path: '/catalog/bars/*', innerText: 'Прутки'},
        {id: 4, desctiption: 'pipers', path: '/catalog/pipers/*', innerText: 'Трубы'},
        {id: 4, desctiption: 'tires', path: '/catalog/tires/*', innerText: 'Шины'},
    ]

    const languages: Array<TMenuItem> = [
        {id: 1, desctiption: 'czech', path: '/cz/*', innerText: 'Провод'},
        {id: 2, desctiption: 'russian', path: '/ru/*', innerText: 'Листы'},
    ]




    return <Navbar menu={menu} catalog={catalog} languages={languages} />
}

export default NavbarContainer
